import React from 'react'

const TrendingCoin = ({ coin }) => {
    return (
        <div className=''>
            <div>{coin.score}</div>
            <div>{coin.name}</div>
            <div>{coin.large}</div>
        </div>
    )
}

const TrendingCoinList = ({ TrendingJSON }) => {
    var TrendingCoin = []
    TrendingJSON.forEach((coin) => {
        TrendingCoin.push(<TrendingCoin coin={coin} key={coin.id}/>)
    })
    return (
        <div className='h-screen'>
            {TrendingCoin}
        </div>
    )
}

const Home = ({ TrendingJSON }) => {
    return (
        <TrendingCoinList TrendingJSON={TrendingJSON}/>
    )
}

export default Home
